import React, {Component} from 'react';
import {Link} from "react-router-dom";
import {PATH_CONTACT} from "../config/configuration";

class Footer extends Component {
    render() {
        return (
            <div className={'footer container-fluid'}>
                <div className={'container nav justify-content-end color-custom'}>
                <ul className={'nav justify-content-end'}>
                    <li className={'nav-item'}>
                        <Link to={PATH_CONTACT} className="nav-link">
                            <span>Instagram</span>
                        </Link>
                    </li>

                    <li className={'nav-item'}>
                        <Link to={PATH_CONTACT} className="nav-link">
                            <span>Facebook</span>
                        </Link>
                    </li>

                    <li className={'nav-item'}>
                        <Link to={PATH_CONTACT} className="nav-link">
                            <span>LinkedIn</span>
                        </Link>
                    </li>
                </ul>
                </div>
            </div>
        );
    }
}

export default Footer;
